import './App.css';
import SettingsBar from './components/SettingsBar'
import Canvas from './components/Canvas';
import ToolBar from './components/ToolBar';

function App() {
  return (
    <div>
      <ToolBar />
      <SettingsBar />
      <Canvas />
    </div>
  );
}

export default App;
